import React from "react";

const About = () => {
  return (
  <div>
      <h2>모두를 위한 은퇴계산기 만든사람 소개</h2>
      <br />
      <h3>이름 : 정승진</h3>
      <h3>학교 및 전공 : 한국방송통신대학교(인천), 컴퓨터과학과</h3>
      <h3>학번 : 201734-243047</h3>
      <br />
      <h2>모두를 위한 은퇴계산기는 이렇게 만들었습니다.</h2>
    </div>
  )
};

export default About;
